- input: "TEXT\x1CC00013748\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission?s letter dated April 1, 2009, regarding the Committee?s Year-End
    2008 report. In the course responding to the Commission?s letter, our research
    revealed several errors in the Committee?s September Monthly and Pre-General reports.
    \ The receipt originally reported from Obama for America, in the amount of $55,993.01
    on August 12, 2008, was reported incorrectly. It has been corrected in the Committee?s
    Amended September Monthly. The receipt is now correctly disclosed as two separate
    transactions, $54,000 from Dollars for Democrats, and $1,993.01 from DNC State
    Party Victory Fund.  MEMO entries for these receipts have been properly disclosed
    in previous reports. Additionally, the receipt reported on the Committee?s Pre-General
    Report from DNC State Party Victory Fund, in the amount of $55,993.01 on October
    8, 2008, has now been correctly disclosed as a transfer from the Democratic National
    Committee on the Committee?s Amended Pre-General Report. These corrections, and
    corrections to the Committee?s totals for column B have been made and amendments
    to the Committee?s September Monthly, October Monthly, Pre-General and Post-General
    have been filed. Additionally, receipts originally reported as coming from DNC
    State Party Victory Fund on August 4, 2008, for $18,922 and November 19, 2008,
    for $10,000, corrected to reflect them as transfers from the Democratic National
    Committee. Thus, the year-to-date total for receipts from DNC State Party Victory
    Fund decreases substantially. In this amendment, there is an additional MEMO Schedule
    A for Committee for Change. \n"
